(13, 'Privacy Policy', '<p>This privacy policy has been compiled to better serve those who are concerned with how their \\\'Personally Identifiable Information\\\' (PII) is being used online. PII, as described in Bangladesh privacy law and information security, is information that can be used on its own or with other information to identify, contact, or locate a single person, or to identify an individual in context. Please read our privacy policy carefully to get a clear understanding of how we collect, use, protect or otherwise handle your Personally Identifiable Information in accordance with our website.\r\nAt Farm2Home we respect the privacy needs of our customers and users. This Privacy Policy outlines what specific information is gathered on the web site under the domain name Farm2Home(www.farm2homebd.com\\\") and how that information is used.\r\nMaintaining the privacy of your information is of paramount importance to us as it helps foster confidence, goodwill and stronger relationships with you, our customers. If, at any time, you have any questions or concerns about our privacy practices, please feel free to contact us via email to Farm2Home. The Site is not intended for use by persons under the age of eighteen. Individuals who are under eighteen are expressly prohibited from posting any personally identifiable information about themselves.</p>\r\n\r\n<div style=\\\"font-size: 1rem; color: #212529; font-weight: 500;  text-transform: uppercase; line-height: normal;\\\">Information Collection and Use</div><br>\r\n\r\n<p>Farm2Home explicitly asks when we need information that personally identifies you (\\\"Personal Information\\\"). Your Personal Information is used to create your personal user account. Contact information and other user-specific information is used only internally by Farm2Home to operate the Site and to communicate with users of the Site (\\\"Users\\\"). Demographic and profile data collected by Farm2Home may be used to tailor this Site or any requested email communications, and to display information that is more relevant to you. Farm2Home also compiles demographic and product use information, but in the aggregate only, and may make that aggregate information publicly available. Information relating to User transactions, such as contact information, Credit Card information, transaction type(s), transaction amount, payment, shipping and billing information, are used internally by Farm2Home and are not disclosed to third parties. Farm2Home may use a User\\\'s contact information to communicate with the User regarding product and service updates, patches, policy changes, billing and other activities relating to the use of the Site, and for marketing purposes.</p>\r\n\r\n\r\n<p>Farm2Home reserves the right to disclose any information if such action is necessary (a) to conform to the requirements of law or to comply with legal process or notice served on Farm2Home, (b) to protect and defend the legal rights or property of Farm2Home, the Site or its Users, or (c) in an emergency, to protect the health and safety of its Users or the general public. Farm2Home further reserves the right to release any information concerning any User if that User participates (or is reasonably suspected of participating) in any illegal activity, even without a notice, warrant, or other court order. Finally, Farm2Home reserves the right to cooperate with law enforcement agencies in identifying those who may be using our servers or services for illegal activities, and to report any suspected illegal activity to law enforcement agencies for investigation or prosecution.</p>\r\n\r\n<p>Your email address is used to only send you information that you have requested. As part of your use of the Site, Farm2Home allows you to select to receive, or not to receive, certain information from Farm2Home adheres strictly to permission-based email policy. Except where requested, Farm2Home will not send you unsolicited email information, commercial offers or advertisements. Farm2Home will not sell, rent, or loan our contact lists (including customer data) to any outside farms. All emails that you have requested will have an option to unsubscribe. Farm2Home will fulfill unsubscribe requests quickly so that no further communications are sent to Users who have stated that they do not wish to receive the specified information. From time to time, we may need to contact you to advise on alterations to the Site and/or updates to this or other policies.</p>\r\n\r\n\r\n<div style=\\\"font-size: 1rem; color: #212529; font-weight: 500;  text-transform: uppercase; line-height: normal;\\\">How do we protect your information?</div><br>\r\n\r\n<p>Our website is scanned on a regular basis for security holes and known vulnerabilities in order to make your visit to our site as safe as possible.\r\nWe use regular Malware Scanning.</p>\r\n\r\n\r\n<p>Your personal information is contained behind secured networks and is only accessible by a limited number of persons who have special access rights to such systems, and are required to keep the information confidential. In addition, all sensitive/credit information you supply is encrypted via Secure Socket Layer (SSL) technology.</p>\r\n\r\n<p>We implement a variety of security measures when a user places an order enters, submits, or accesses their information to maintain the safety of your personal information.</p>\r\n\r\n<p>All transactions are processed through a gateway provider and are not stored or processed on our servers.</p>\r\n\r\n<div style=\\\"font-size: 1rem; color: #212529; font-weight: 500;  text-transform: uppercase; line-height: normal;\\\">Third-party disclosure</div><br>\r\n\r\n<p>We do not sell, trade, or otherwise transfer to outside parties your Personally Identifiable Information.</p>\r\n\r\n<div style=\\\"font-size: 1rem; color: #212529; font-weight: 500;  text-transform: uppercase; line-height: normal;\\\">Cookies</div><br>\r\n\r\n<p>Cookies are small files that a site or its service provider transfers to your computer\\\'s hard drive through your Web browser (if you allow) that enables the site\\\'s or service provider\\\'s systems to recognize your browser and capture and remember certain information. For instance, we use cookies to help us remember and process the items in your shopping cart. They are also used to help us understand your preferences based on previous or current site activity, which enables us to provide you with improved services. We also use cookies to help us compile aggregate data about site traffic and site interaction so that we can offer better site experiences and tools in the future.\r\nWe use cookies to:</p>\r\n\r\n<p> Help remember and process the items in the shopping cart.</p>\r\n<p> Understand and save user\\\'s preferences for future visits.</p>\r\n<p> Compile aggregate data about site traffic and site interactions in order to offer better site experiences and tools in the future. We may also use trusted third-party services that track this information on our behalf.</p>\r\n\r\n<p>You can choose to have your computer warn you each time a cookie is being sent, or you can choose to turn off all cookies. You do this through your browser settings. Since browser is a little different, look at your browser\\\'s Help Menu to learn the correct way to modify your cookies.</p>\r\n\r\n<p>If you turn cookies off, some of the features that make your site experience more efficient may not function properly. It may also cause transactions to not process.</p>', 1, 5),
(16, 'Term & Services', '<p>This legal notice applies to the entire content of the web site under the domain name  (\\\"www.farm2homebd.com\\\") and to any correspondence by e-mail between Farm2Home and any User (as defined below). Please read these terms and conditions carefully before using the Site. Use of the Site indicates that you accept all these terms and conditions regardless of whether or not you choose to register or already have been registered with us. If you do not accept any of these terms and conditions please do not use this Site. \r\nPrior to use this Site, please visit and read the following pages.</p>\r\n\r\n<div style=\\\"font-size: 1rem; color: #212529; font-weight: 500;  text-transform: uppercase; line-height: normal;\\\">1. Introduction.</div><br>\r\n\r\n<p>These terms and conditions (\\\"User Terms\\\") apply to all persons (\\\"User\\\") who access the Site. By accessing the Site, each User acknowledges the acceptance of these terms and conditions. Farm2Home only reserves the right to change these User Terms from time to time at its sole decision without prior notification. Any change will be deemed to take effect twenty-four (24) hours after posting on the Site and will be deemed to be accepted by Users who continue to access the Site thereafter. In the case of any violation of these User Terms, Farm2Home reserves the right to seek all remedies available by law and in equity for such violations.</p>\r\n\r\n<div style=\\\"font-size: 1rem; color: #212529; font-weight: 500;  text-transform: uppercase; line-height: normal;\\\">2. Ownership and Copyright.</div><br>\r\n\r\n<p>2.1 All documents, information or materials (\\\" Information\\\") on the Site are protected by copyright and unless indicated otherwise, at any time remain the property of Farm2Home Subject to paragraph 2.2 below. No portion of the Information on the Site may be reproduced in any form, or by any means, without prior written permission from Farm2Home. Visitors or users are 