ranty or representation as to the suitability of the information contained or referred to in, or accessible from, the Site (\\\"Site Information\\\"), for any purpose. All Site Information is provided \\\" as is\\\" without warranty of any kind, either express or implied, including but not limited to, all warranties and conditions of merchantability, fitness for a particular purpose, title and non-infringement. The Site Information could include inaccuracies or typographical errors. Changes are periodically added to the information herein; these changes may be incorporated in new editions of the Site at any time without notice. Farm2Home expressly disclaims liability for any errors or omissions in the Site Information contained or referred to in, or accessible from, the Site or any website linked to or from the Site.</p>\r\n\r\n<div style=\\\"font-size: 1rem; color: #212529; font-weight: 500;  text-transform: uppercase; line-height: normal;\\\">5. Disclosure; Forward-Looking Statements</div><br>\r\n\r\n<p>Some of the information on the Site may contain projections or other forward-looking statements regarding future events or the future financial performance of Farm2Home or companies which exhibit on the Site. We wish to caution you that these statements are only predictions and those actual events or results may differ materially.</p>\r\n\r\n<div style=\\\"font-size: 1rem; color: #212529; font-weight: 500;  text-transform: uppercase; line-height: normal;\\\">6. Links To and From third-party sites (Third-party links)</div><br>\r\n\r\n<p>6.1 Links to third party websites on the Site are provided solely for your convenience. Using these links probably will leave the Site towards the corresponding site. Farm2Home has not reviewed all of these third-party websites and does not have any control of all of these third-party websites and thus is not responsible for their content or availability or anything related to these websites. Farm2Home, therefore, does not endorse or make any representations about them, or any material found there, or any results that may be obtained from using them. If you decide to access any of the third-party websites linked to the Site, you do so entirely at your own risk.</p>\r\n\r\n<p>6.2 Any User may create links to the Site on the basis that he links to, but does not replicate, the home page of the Website, and subject to the following conditions: \r\n    (a) he/she does not remove, distort or otherwise alter the size or appearance of the Farm2Home logo:\r\n    (b) he/she does not create a frame or any other browser or border environment around the Site; \r\n    (c) he/she does not in any way imply that Farm2Home is endorsing any products or services other than its own; \r\n    (d) he/she does not misrepresent his relationship with Farm2Home nor present any other false information about Farm2Home:\r\n    (e) he/she does not otherwise use any Farm2Home trademarks displayed on the Site without express written permission from Farm2Home:\r\n    (f) he/she does not link from a website that is not owned by him/her; and \r\n    (g) his/her website does not contain content that is distasteful, offensive or controversial, infringes any intellectual property rights or other rights of any other person or otherwise does not comply with all applicable laws and regulations.</p>\r\n\r\n<p>6.3 Farm2Home expressly reserves the right to revoke the right granted in paragraph 6.2 for breach of the User Terms or of any other terms and conditions (including those relating to exhibitors) which govern a User and to take any action it deems appropriate.\r\n6.4 Each User shall fully indemnify Farm2Home for any loss or damage suffered by Farm2Home or any of its group companies for breach of paragraph 6.2.</p>\r\n\r\n<div style=\\\"font-size: 1rem; color: #212529; font-weight: 500;  text-transform: uppercase; line-height: normal;\\\">7. Registration</div><br>\r\n\r\n<p>7.1 Each registration is for a single user only. Farm2Home does not permit Users to share their user names or passwords with any other person nor with multiple users on a network.</p>\r\n\r\n<p>7.2 It is the Users\\\' responsibility to keep their password and user name secure and not to disclose them to third parties for any purpose. Farm2Home accepts no responsibility for any actions caused by a User disclosing his password and/or user names to third parties.</p>\r\n\r\n<div style=\\\"font-size: 1rem; color: #212529; font-weight: 500;  text-transform: uppercase; line-height: normal;\\\">8. Limitation of Liability</div><br>\r\n\r\n<p>8.1 Farm2Home and its officers, directors, shareholders or agents exclude any liability for any amount or kind of loss or damage that may result to you or a third party (including without limitation any direct, indirect, punitive or consequential loss or damage, or any loss of income, profits, goodwill, data, contracts or loss or damage arising from or connected in any way to business interruption and whether in tort, contract or otherwise) in connection with the use or inability to use or the results of the use of the Site or any web site linked to or from the Site, including but not limited to viruses that may infect your computer hardware or software.\r\n8.2 Nothing in these User Terms shall exclude or limit Farm2Home liability for death or personal injury caused by negligence, fraud or any liability which cannot be excluded or limited under applicable law.</p>\r\n\r\n<div style=\\\"font-size: 1rem; color: #212529; font-weight: 500;  text-transform: uppercase; line-height: normal;\\\">9. Service Access</div><br>\r\n\r\n<p>9.1 While Farm2Home works to ensure that the Site is normally available 24 hours a day, Farm2Home shall not be liable if for any reason the Site is unavailable at any time for any period.</p>\r\n\r\n<p>9.2 Access to the Site may be suspended temporarily and without notice in the case of system failure, maintenance and/or repair or for reasons beyond the control of Farm2Home.</p>\r\n\r\n<div style=\\\"font-size: 1rem; color: #212529; font-weight: 500;  text-transform: uppercase; line-height: normal;\\\">10. Visitor Material and Conduct</div><br>\r\n\r\n<p>10.1 Other than personally identifiable information, which is covered under our Privacy Policy, any material transmitted or posted to the Site by a User shall be considered non-confidential and non-proprietary. Farm2Home shall have no obligations with respect to such material. Farm2Home and its designees shall be free to copy, disclose, distribute, incorporate and otherwise use such material and all data, images, sounds, text and other things embodied therein for any and all commercial or non-commercial purposes.</p>\r\n\r\n<p>10.2 Users are prohibited from posting or transmitting to or from the Site any material: \r\n    (a) that is threatening, defamatory, obscene, indecent, seditious, offensive, pornographic, abusive, liable to incite racial hatred, discriminatory, menacing, scandalous, inflammatory, blasphemous, in breach of confidence, in breach of privacy or which may cause annoyance or inconvenience; or \r\n    (b) for which that User has not obtained all necessary licenses and/or approvals; or \r\n    (c) which constitutes or encourages conduct that would be considered a criminal offense, give rise to civil liability, or otherwise be contrary to the law of or infringe the rights of any third party, in any country in the world; or \r\n    (d) which is technically harmful (including, without limitation, computer viruses, logic bombs, Trojan horses, worms, harmful components, corrupted data or other malicious software or harmful data).</p>\r\n\r\n<p>10.3 No User may misuse the Site (including, without limitation, by hacking).</p>\r\n\r\n<p>10.4 Farm2Home will fully co-operate with any law enforcement authorities or court order requesting or directing Farm2Home to disclose the identity or locate anyone posting any material in breach of paragraphs 10.2 or 10.3 above.</p>\r\n\r\n<div style=\\\"font-size: 1rem; color: #212529; font-weight: 500;  text-transform: uppercase; line-height: normal;\\\">11. Governing Law and Jurisdiction</div><br>\r\n\r\n<p>These User Terms shall be governed by and construed in accordance with the Laws of Bangladesh and the parties hereto submit to the exclusive jurisdiction of the Bangladesh Courts.</p>\r\n\r\n<div style=\\\"font-size: 1rem; color: #212529; font-weight: 500;  text-transform: uppercase; line-height: normal;\\\">**Purchase Terms**</div><br>\r\n\r\n\r\n<div style=\\\"font-size: 1rem; color: #212529; font-weight: 500;  text-transform: uppercase; line-height: normal;\\\">1. INTRODUCTION</div><br>\r\n\r\n<p>This legal notice applies to any person who purchases or wishes to purchase a product (\\\"Purchaser\\\") which is available on the web site under the domain name Farm2Home(\\\" Site\\\") and to any correspondence by e-mail between Farm2Home Company, Inc. (Farm2Home ) and any Purchaser. Please read these Purchaser Terms carefully before using the Site. The use of the Site as a Purchaser indicates that you accept these terms and conditions. If you do not accept these Purchaser Terms Please do not use the Site as a Purchaser.</p>\r\n\r\n<div style=\\\"font-size: 1rem; color: #212529; font-weight: 500;  text-transform: uppercase; line-height: normal;\\\">2. PAYMENT TERMS FOR PRODUCT PURCHASES</div><br>\r\n\r\n<p>2.1 Products which are made available to all persons who access the Site (\\\" Users\\\") (\\\"Products\\\") can be ordered either by Site purchase or by telephone.</p>\r\n\r\n<p>2.2 Payment for a Product which is ordered via Site purchase or telephone shall be made after delivery of the product has been made.</p>\r\n\r\n<p>2.3 All prices quoted are exclusive of sales or other taxes, which will be in addition to the price at the prevailing rate at the time.</p>\r\n\r\n<p>2.4 In the event of non-payment for a Product under any circumstances the User will be responsible for all costs incurred by Farm2Home including without limitation any legal fees incurred. Invoices not paid within thirty days of the invoice date shall be subject to interest at 10% per annum above the Bangladesh base rate.</p>\r\n\r\n<div style=\\\"font-size: 1rem; color: #212529; font-weight: 500;  text-transform: uppercase; line-height: normal;\\\">3. DELIVERY</div><br>\r\n\r\n<p>3.1 Products shall be delivered via a various delivery channel like Shohoz, Pathao, Food Panda.</p>\r\n\r\n<p>3.2 The day of delivery will be advised at the time of Order.</p>\r\n\r\n<div style=\\\"font-size: 1rem; color: #212529; font-weight: 500;  text-transform: uppercase; line-height: normal;\\\">4. RETURNS & REFUNDS</div><br>\r\n\r\n<p>We, unfortunately, cannot accept returns of products once they have been delivered. Refunds will not normally be offered, however, all refund requests will be judged on a case by case basis at the discretion of the management. Please be sure to read all the available information about a product before you place your order. If you have any questions about a product simply contact us for assistance.</p>\r\n\r\n<div style=\\\"font-size: 1rem; color: #212529; font-weight: 500;  text-transform: uppercase; line-height: normal;\\\">**Communications from the Site**</div><br>\r\n\r\n<div style=\\\"font-size: 1rem; color: #212529; font-weight: 500;  text-transform: uppercase; line-height: normal;\\\">Special Offers and Updates</div><br>\r\n\r\n<p>We send all new users a welcoming email to confirm their password and username. A follow-up email will be sent to new users explaining in detail how the service works. Established users will occasionally receive information on products, services, special deals, and newsletters. Out of respect for the privacy of our Users, we present the option to not receive these types of communications. Customers can unsubscribe via the unsubscribe mechanism at the bottom of each email.</p>\r\n\r\n<div style=\\\"font-size: 1rem; color: #212529; font-weight: 500;  text-transform: uppercase; line-height: normal;\\\">Newsletter</div><br>\r\n\r\n<p>If a User wishes to subscribe to our newsletter(s), we ask for contact information such as name and email address. Out of respect for our user\\\\\\\'s privacy, we provide a way to opt-out of these communications via the unsubscribe mechanism at the bottom of each email or by sending an email with the Users name and \\\\\\\"Opt-Out\\\\\\\" in the message.</p>\r\n\r\n<div style=\\\"font-size: 1rem; color: #212529; font-weight: 500;  text-transform: uppercase; line-height: normal;\\\">Customer Service</div><br>\r\n\r\n<p>We communicate with users on a regular basis to provide requested services and in regards to issues relating to their account we reply via email or phone, in accordance with the user\\\\\\\'s wishes.</p>\r\n\r\n<div style=\\\"font-size: 1rem; color: #212529; font-weight: 500;  text-transform: uppercase; line-height: normal;\\\">Website Usage Information</div><br>\r\n\r\n<p>We use your IP address to help diagnose problems with our server and to administer our Site. We do not link your IP address to any personally identifiable information. We use tracking information to determine which areas our site users visit based on traffic to those areas. Farm2Home does not track what individual users read, but rather how often each page is visited. This helps us maintain a superior and informative website for you.</p>\r\n\r\n<div style=\\\"font-size: 1rem; color: #212529; font-weight: 500;  text-transform: uppercase; line-height: normal;\\\">Payment</div><br>\r\n\r\n<p>DeliveryBizPro.com stores your credit card data. It is encrypted through the Payment Card Industry Data Security Standard (PCI-DSS). Your purchase transaction data is stored only as long as is necessary to complete your purchase transaction. After that is complete, your purchase transaction information is deleted.</p>\r\n\r\n<p>All direct payment gateways adhere to the standards set by SSL which is a joint effort of brands like Visa, MasterCard, American Express and Discover. \r\nSecurity</p>\r\n\r\n<p>To protect your personal information, we take reasonable precautions and follow industry best practices to make sure it is not inappropriately lost, misused, accessed, disclosed, altered or destroyed.</p>\r\n\r\n<p>If you provide us your credit card information, the information is encrypted using secure socket layer technology (SSL). Although no method of transmission over the Internet or electronic storage is 100% secure, we follow all PCI-DSS requirements and implement additional generally accepted industry standards.</p>\r\n\r\n<div style=\\\"font-size: 1rem; color: #212529; font-weight: 500;  text-transform: uppercase; line-height: normal;\\\">Policy Modifications</div><br>\r\n\r\n<p>Farm2Home may change this Privacy Policy from time to time. If/when Farm2Home makes changes to this privacy statement, it will automatically become effective within twenty-four (24) hours after it is initially posted on the Site. You are responsible for checking this page periodically for changes and updates to this Privacy Policy, notified by the date of the last update. This Privacy Policy is subject to the terms and conditions of use set forth in the Terms and Conditions for Users, including provisions regarding change or modification of this Privacy Policy.</p>\r\n\r\n<p>If you have any questions about our privacy statement, the information we have collected from you online, the practices of this site, or your dealings with this web site, please contact:</p>', 1, 6),
(19, 'Refund Policy', '<h2><strong>Refund policy</h2></strong>\r\n\r\n<p>It is Farm2Home top priority to satisfy all of our customers. If you are not 100% satisfied with your purchase, please contact our office at ( Address and Ph number )</p>', 1, 7),
(26, 'Refund Policy', '', 3, 7),
(22, 'About Us', '<div style=\\\"font-size: 1rem; color: #212529; font-weight: 500;  text-transform: uppercase; line-height: normal;\\\">WHO WE ARE</div><br>\r\n\r\n<p>What was started in earlier 2019 as a tribute to nostalgia has evolved to the Beginning of todays Farm2Home era. Having a clear vision of bringing back The Milkman, Ghosal, by connecting people to locally sourced food, and helping the environment in the process. Over time they partnered with more farmers and producers. We are passionate about our food system.\r\nOur products are sourced from very Well-Known local farms so that we can be sure about the origins and assure you the quality of food we offer.</p>\r\n\r\n<div style=\\\"font-size: 1rem; color: #212529; font-weight: 500;  text-transform: uppercase; line-height: normal;\\\">WHAT WE DO</div><br>\r\n\r\n<p>Do you always worry about the food you are feeding your family? Do you wonder what acetate, dextrose, diglycerides, thiamine mononitrate, guar gum, or any of those other ingredients you cant pronounce are? Do you feel guilty because you dont always have time to read the labels when you are shopping? Well, so do we! And we believe wholeheartedly that our food system is killing us. Thats why we are committed to partnering only with farmers and producers who share our passion for REAL, minimally (or not) processed food. You can be assured that the products we carry are free from all those impossible-to-pronounce additives found in conventional foods. And they are sourced from small, family-owned farms and businesses that follow sustainable practices and treat their animals humanely. This is our commitment to you. We will never carry a product that we are not 100% comfortable feeding our own kids.</p>\r\n\r\n<div style=\\\"font-size: 1rem; color: #212529; font-weight: 500;  text-transform: uppercase; line-height: normal;\\\">OUR TEAM</div><br>\r\n\r\n<p>We have the BEST team around! If you call or email us youll get the best assistance from our team. We are glad to accept any recommendations from you. Thank you for allowing us to connect our farmers and producers to you and your family!</p>\r\n\r\n<div style=\\\"font-size: 1rem; color: #212529; font-weight: 500;  text-transform: uppercase; line-height: normal;\\\">1. BUILD YOUR FRESH ORDER</div><br>\r\n\r\n<p>All you need to do is just Register to Farm2Home,  either online by visiting <a href=\\\"http://www.farm2homebd.com\\\" style=\\\"color:blue;\\\">www.farm2homebd.com<a> or through our mobile app what you will get in google play store. Once you are registered its time to begin having real fresh & quality food from our partnered Farm and Producers.</p>\r\n\r\n<p>Choose from our products: dairy, Ghee, Mustard oil, Honey, Kali Jeera oil, Sondhesh - whatever you select, you can be sure that the products are natural and sourced from producers that share our passion for our food-system.</p>\r\n\r\n<div style=\\\"font-size: 1rem; color: #212529; font-weight: 500;  text-transform: uppercase; line-height: normal;\\\">2. WE DELIVER</div><br>\r\n\r\n<p>After finalizing your products and quantity, select your convenient payment option. Our Farm2Home team will do the rest and make sure that it\\\'s ready to be delivered right to your door! \r\nYOU ENJOY!</p>\r\n\r\n<p>Just wait up to find farm-fresh goodness at your door! Now its time for you and your family to enjoy local, non-processed, farm-fresh products.\r\nTASTE and LOVE the difference!</p>\r\n\r\n<img src=\\\"http://farm2homebd.com/images/content/1.jpg\\\" width=\\\"400px\\\">\r\n<br>\r\n<img src=\\\"http://farm2homebd.com/images/content/2.jpg\\\" width=\\\"400px\\\">\r\n<br>\r\n<img src=\\\"http://farm2homebd.com/images/content/3.jpg\\\" width=\\\"400px\\\">', 1, 8),
(24, 'About Us', '', 3, 8),
